import React, { useEffect, useState } from 'react'
import "./Navbar.css"
import HomeRoundedIcon from '@material-ui/icons/HomeRounded';
import CloudUploadOutlinedIcon from '@material-ui/icons/CloudUploadOutlined';
import PersonRoundedIcon from '@material-ui/icons/PersonRounded';
import ExitToAppIcon from '@material-ui/icons/ExitToApp';
function Navbar() {

    const [loggedIn, setLoggedIn] = useState()

    useEffect(() => {
        setLoggedIn(localStorage.getItem("loggedIn"))
    }, [localStorage.getItem("loggedIn")])

    const Logout = () => {

        localStorage.setItem("loggedIn", false)
        localStorage.setItem("username", "")

    }
    if (localStorage.getItem("username", "")) {
        return (


            <div className="Navbar">

                <a href="/"><HomeRoundedIcon />Home</a>
                <a href="/upload"><CloudUploadOutlinedIcon />Upload</a>
                <div> <a href="/profile"><PersonRoundedIcon />Profile</a></div>
                <div className="Logout"><b href="/"><button onClick={() => {
                    Logout()
                }}>< ExitToAppIcon />Logout</button></b></div>

            </div>

        )
    }
    return (
        <div className="Navbar">
            <a href="/">Home</a>
            <a href="/login">Login</a>
            <a href="/register">Register</a>

        </div>
    )

}

export default Navbar
